import {RastersDelegate} from './RastersDelegate';
import {RastersService} from '../RastersService';
import {Observable, BehaviorSubject} from 'rxjs';
import {RasterEntity} from 'src/core/rasters/RasterEntity';
import {RasterParameter} from 'src/core/rasters/RasterParameter';
import {RasterImage} from 'src/core/rasters/RasterImage';
import {RastersGroup} from 'src/core/rasters/RastersGroup';
import {Envelope} from 'src/core/types/Envelope';

export class InternalRastersDelegate implements RastersDelegate {

  private patterns: Map<number, BehaviorSubject<RasterParameter[]>> = new Map();
  private rasterImages: Map<RasterParameter, any> = new Map();
  private host: RastersService;


  /**
   * 
   */
  public setHost(host: RastersService) {
    this.host = host;
  }

  /**
   * 
   */
  public loadRasters(): void {
    setTimeout(() => {
      const arr: RastersGroup[] = [
        new RastersGroup(0, "Global Horizontal Irradiance", [0])
        , new RastersGroup(1, "NOAA", [1])
        , new RastersGroup(2, "METRIC-ET", [2])
        , new RastersGroup(3, "GOES-W", [3, 4])
      ];
      this.host.rasterGroups.next(arr);
      this.setImages(arr);
    });
  }

  /**
   * 
   */
  private setImages(arr: RastersGroup[]) {
    const imgs = [ 
      {"test_source" : "data:image/png;base64,"}
      ,{"test_source" :  "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAoAAAAJCAIAAACExCpEAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAAASSURBVChTY5DutMGDRqZ0pw0A4ZNOwQNf"}
      ,{"test_source" :  "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAAFCAYAAACNbyblAAAAHElEQVQI12P4//8/w38GIAXDIBKE0DHxgljNBAAO9TXL0Y4OHwAAAABJRU5ErkJggg=="}
      ,{"test_source" :  "data:application/octet-stream;base64,"}
      ,{
        Jan182023 :  "data:image/jpeg;base64,"
        , Jan172023: "data:image/png;base64,"
        , Jan162023: "data:image/png;base64,"}
    ];
    arr.forEach(a => {
      a.rasterIds.forEach(rasterId => {
        this.host.getParameters(rasterId).subscribe((parameters) => {
          parameters.forEach(p => {
            const imgr:any = imgs[p.rasterId];
            const img = imgr[p.parameter.key];
            this.rasterImages.set(p, img);
          });
        });
      })
    });
  }


  /**
 * 
 */
  public loadRasterEntity(rasterId: number, callback: any): void {
    setTimeout(() => {
      const e = new RasterEntity(rasterId);
      this.host.rastersmap.set(rasterId, e);
      callback(e);
    }, 10);
  }


  /**
   * 
   */
  public getRasterImage(param: RasterParameter): Observable<RasterImage> {
    const imageUrl = this.rasterImages.get(param);
    const xmin = -13525318;
    const ymin = 4439106;
    const xmax = -13358338;
    const ymax = 4565942;
    const spatialReference = 32610;
    const envelope = new Envelope(xmin, xmax, ymin, ymax, spatialReference);
    const obs: BehaviorSubject<RasterImage> = new BehaviorSubject(null);
    obs.next(new RasterImage(imageUrl, envelope));
    return obs;
  }

  /**
   * 
   */
  public getParameters(rasterId: number): Observable<RasterParameter[]> {
    if (!this.patterns.has(rasterId)) {
      let arr = [];
      if (rasterId !== 4) {
        const parameter = {
          key: "test_source",
          view: [
            {
              type: 'label'
              , name: 'Raster ID'
              , value: rasterId
            }
            , {
              type: 'label'
              , name: 'Time Stamp'
              , value: 'Jan. 17, 2023'
            }
            , {
              type: 'label'
              , name: 'latitude-range '
              , value: '2222.0, 2222.0'
            }
            , {
              type: 'label'
              , name: 'longitude-range '
              , value: '2222.0, 2222.0'
            }
          ]
        }; 
        arr = [
        new RasterParameter(rasterId, parameter)
        ]
      } else {
        const parameters = [{
          key: "Jan182023",
          view: [
            {
              type: 'label'
              , name: 'Raster ID'
              , value: rasterId
            }
            , {
              type: 'label'
              , name: 'Time Stamp'
              , value: 'Jan. 17, 2023'
            }
            , {
              type: 'label'
              , name: 'latitude-range '
              , value: '2222.0, 2222.0'
            }
            , {
              type: 'label'
              , name: 'longitude-range '
              , value: '2222.0, 2222.0'
            }
          ]
        }
        , {
          key: "Jan172023",
          view: [
            {
              type: 'label'
              , name: 'Raster ID'
              , value: rasterId
            }
            , {
              type: 'label'
              , name: 'Time Stamp'
              , value: 'Jan. 17, 2023'
            }
            , {
              type: 'label'
              , name: 'latitude-range '
              , value: '2222.0, 2222.0'
            }
            , {
              type: 'label'
              , name: 'longitude-range '
              , value: '2222.0, 2222.0'
            }
          ]
        }
         , {
          key: "Jan162023",
          view: [
            {
              type: 'label'
              , name: 'Raster ID'
              , value: rasterId
            }
            , {
              type: 'label'
              , name: 'Time Stamp'
              , value: 'Jan. 17, 2023'
            }
            , {
              type: 'label'
              , name: 'latitude-range '
              , value: '2222.0, 2222.0'
            }
            , {
              type: 'label'
              , name: 'longitude-range '
              , value: '2222.0, 2222.0'
            }
          ]
        }
        ]; 
        arr = parameters.map(p=>new RasterParameter(rasterId, p)); 
        
      }
      ;
      
      const value = new BehaviorSubject(arr);
      this.patterns.set(rasterId, value);
    }
    const result = this.patterns.get(rasterId);
    return result;
  }
}
